        if num < 2:
            return False
        for i in range(1, int(num ** 0.5) + 1):
            if num % i == 0:
                return False
        return True
    cuts.append(0)
    cuts.append(n)
    cuts.sort()
    pq = []
    for i in range(1, len(cuts)):
        if not is_prime(cuts[i] - cuts[i - 1]):
            return -1
        heapq.heappush(pq, cuts[i] - cuts[i - 1])
    res = 0
    while len(pq) > 1:
        x = heapq.heappop(pq)
        y = heapq.heappop(pq)
        res += x + y
        heapq.heappush(pq, x + y)
    return res

